function insertEpubJsScript(callback) {
  const script = document.createElement('script');
  var baseUrl = `${window.location.protocol}//${window.location.host}`;

  // Ton chemin vers le plugin epub.js (dans ton système plugins)
  script.src = `${baseUrl}/plugins/name/epubjs/file/epubjs.js`;

  script.onload = function () {
    console.log('✅ epub.js chargé');
    if (typeof callback === 'function') {
      callback();
    } else if (typeof window.startApp === 'function') {
      window.startApp();
    } else {
      console.warn('⚠️ startApp() not defined at load time');
    }
  };

  document.head.appendChild(script);
}

function insertJsZipScript(callback) {
  const script = document.createElement('script');
  var baseUrl = `${window.location.protocol}//${window.location.host}`;

  // Chemin vers ton plugin JSZip
  script.src = `${baseUrl}/plugins/name/epubjs/file/jszip.min-3.1.5.js`;

  script.onload = function () {
    console.log('✅ JSZip chargé');
    if (typeof callback === 'function') callback();
  };

  document.head.appendChild(script);
}

// Exemple : charger JSZip puis EPUB.js
insertJsZipScript(function () {
  insertEpubJsScript(function () {
    console.log('✅ JSZip et EPUB.js sont prêts');
  });
});
